import Category from "./category";
import ProductDetail from "./ProductDetail";

abstract class Item {
  id: number;
  title: string;
  price: number;
  pictureUrl: string;
  category: Category;

  constructor(id: number, title: string, price: number, pictureUrl: string, category: Category) {
    this.id = id;
    this.title = title;
    this.price = price;
    this.pictureUrl = pictureUrl;
    this.category = category;
  }

}

export default Item;
